import React from 'react';
import './assets/css/App.css';
import 'bootstrap/dist/css/bootstrap.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import Login from './components/login'


function App() {
  return (
    <div className="App">
      <React.Fragment>
        <Router>
          <Switch>
            <Route path="/" exact>
              <Login />
            </Route>
          </Switch>
        </Router>
      </React.Fragment>
    </div>
  );
}

export default App;
